pragma solidity ^0.8.0;

import "@openzeppelin/contracts/access/Ownable.sol";


// Know Your Customer Contract
contract KycContract is Ownable{

    mapping(address => bool)   allowed; 

    uint public kycPrice = 10;

    event KycPurchased(address from, uint value);

    function buyKyc() external payable {
        require(msg.value >= kycPrice, "You need to send more money to buy kyc");
        allowed[msg.sender] = true;
        emit KycPurchased(msg.sender, msg.value);
    }

    function withdrawKyc() external onlyOwner {
        uint balance = address(this).balance;
        require(balance > 0, "nothing to withdraw...");
        payable(msg.sender).transfer(balance);
    }

    function setKycPrice(uint _amountInWei) external onlyOwner {
        require(_amountInWei > 0, "you cannot set the kyc for free");
        kycPrice = _amountInWei;
    }

    function setKycCompleted(address _addr) public onlyOwner {
        allowed[_addr] = true;
        emit KycPurchased(_addr, 0);
    }

    function setKycRevoked(address _addr) public onlyOwner { 
        allowed[_addr] = false;
    }

    function kycCompleted(address _addr) public view returns(bool) {
        return allowed[_addr]; 
    }


}","keccak256":"0xd6c719ea8fe35f2172f8dba891bf10deec3a12ff528ae60b851bb561be437abd","license":"MIT"},"contracts/MyTokenSale.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

// import "./Crowdsale.sol";

import "./KycContract.sol";

import "./mint/MintedCrowdsale.sol";

contract MyTokenSale is MintedCrowdsale {


    KycContract kyc;

    constructor (
        uint256 rate,    // rate in TKNbits
        address payable wallet,
        IERC20 token,
        KycContract _kyc
    )
        MintedCrowdsale()
        Crowdsale(rate, wallet, token)
    {
        kyc = _kyc;
    }

    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal view override {
        super._preValidatePurchase(beneficiary, weiAmount);
        require(kyc.kycCompleted(msg.sender), "KYC not completed, purchase not allowed");

    }


}","keccak256":"0x30040adae3f08901137ebee7e0b81afd67010fb88e2cccefc177600072d53051","license":"MIT"},"contracts/mint/ERC20Mintable.sol":{"content":"// SPDX-License-Identifier: MIT
