}","keccak256":"0x949fff5e29f963398e2f3ec75a130753431fc9e002df86351fbe77ea25cde60a","license":"MIT"},"contracts/mint/MintedCrowdsale.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "../Crowdsale.sol";
import "./ERC20Mintable.sol";

/**
 * @title MintedCrowdsale
 * @dev Extension of Crowdsale contract whose tokens are minted in each purchase.
 * Token ownership should be transferred to MintedCrowdsale for minting.
 */
abstract contract MintedCrowdsale is Crowdsale {
    /**
     * @dev Overrides delivery by minting tokens upon purchase.
     * @param beneficiary Token purchaser
     * @param tokenAmount Number of tokens to be minted
     */
    function _deliverTokens(address beneficiary, uint256 tokenAmount) internal override  {
        // Potentially dangerous assumption about the type of the token.
        require(
            ERC20Mintable(address(token())).mint(beneficiary, tokenAmount),
                "MintedCrowdsale: minting failed"
        );
    }
}","keccak256":"0x1e9b5a65d261b2c57a3b2311dc9c4c4c59857b8e4e3bb6d4e7c68a6222ee1877","license":"MIT"},"contracts/mint/MinterRole.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Context.sol";
import "./RolesLibrary.sol";


contract MinterRole is Context {

    using RolesLibrary for RolesLibrary.Role;

    event MinterAdded(address indexed account);
    event MinterRemoved(address indexed account);

    RolesLibrary.Role private _minters;

    constructor () {
        _addMinter(_msgSender());
    }

    modifier onlyMinter() {
        require(isMinter(_msgSender()), "MinterRole: caller does not have the Minter role");
